기시럽\n소금의 유통기한은? 천일염\n세상에서 가장 억울한 도형은? 원통\n우유가 넘어지면? 아야\n아몬드가 죽으면? 다이아몬드\n소가 죽으면? 다이소\n깨가 죽으면? 주근깨\n토끼가 쓰는 빗은? 래빗\n세상에서 가장 쉬운 숫자는? 190,000\n비가 1시간 동안 내리면? 추적 60분\n'),(_binary '','2024-08-14 17:49:24.914917',21,109,'2024-08-14 17:49:39.506067',2011,'안녕하세요 원우형','전 원우형의 극성팬 까비라고 해요.\n전 고양이에요\n고먐미 애요요오옹오여오오ㅛ요오오오용옹'),(_binary '','2024-08-14 17:51:22.233440',2,109,'2024-08-14 17:53:29.515129',2012,'원우 형님께,','안녕하세요, 형님! 요즘 어떻게 지내고 계신가요? 바쁜 일상 속에서도 형님께서 항상 건강하고 행복하시기를 바라는 마음입니다.\n\n형님과 함께 했던 시간들이 종종 떠오르곤 합니다. 때로는 웃음 가득한 순간들, 때로는 깊은 대화를 나누었던 시간들이요. 그런 순간들이 지금의 저에게 큰 힘이 되고, 앞으로도 그 기억들을 떠올리며 힘을 얻을 것 같습니다.');
